import React, { Component } from 'react';
import slide1 from "../components/images/slide-1.png";
import slide2 from "../components/images/slide-2.jpeg";
import slide3 from "../components/images/slide-3.jpeg";
import slide4 from "../components/images/slide-4.jpg";
import slide5 from "../components/images/slide-5.jpeg";
import "../style/slider.css";

import ReactDOM from 'react-dom';
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';


export default  function MainSlider() {
  return (
  <Carousel autoPlay = {true} showArrows={true} showStatus = {false}>
  <Carousel.Item>
      <div>
          <img alt="s1" src={slide1}  />
          <p className="legend">Legend 1</p>
      </div>
      </Carousel.Item>
      <Carousel.Item>
      <div>
          <img alt="s2" src={slide2}  />
          <p className="legend">Legend 2</p>
      </div>
      </Carousel.Item>
      <Carousel.Item>
      <div>
          <img alt="s3" src={slide3}  />
          <p className="legend">Legend 3</p>
      </div>
      </Carousel.Item>
      <Carousel.Item>
      <div>
          <img alt="s4" src={slide4}  />
          <p className="legend">Legend 4</p>
      </div>
      </Carousel.Item>
      <Carousel.Item>
      <div>
          <img alt="s5" src={slide5} />
          <p className="legend">Legend 5</p>
      </div>
      </Carousel.Item>

  </Carousel>
  );
}



